import React from 'react';
import { BrowserRouter, Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import SideMenu from './defultComponent/sidebar';
import RouterA from './defultComponent/router';
import { ProSidebar } from 'react-pro-sidebar';
import GetTables from './modules/table/components/tables';
import TablesIndex from './modules/table/components/index.component';
import TablesView from './modules/table/components/view.component';
import TablesEdit from './modules/table/components/edit.component';
import MenusIndex from './modules/menu/components/index.component';
import MenusView from './modules/menu/components/view.component';
import MenusEdit from './modules/menu/components/edit.component';
import CustomersIndex from './modules/customers/components/index.component';
import CustomersView from './modules/customers/components/view.component';

class App extends React.Component {
  constructor(props, state) {
    super(props);

    console.log("====", props, state);
  }
  render() {
    return (

      <BrowserRouter>
        <div style={{ backgroundColor: 'white' }} >
          <div className="row" >
            <div className="col col-3">
              <SideMenu />
            </div>
            <div className="col col-9" style={{ padding: "40px" }}>
              <div style={{ width: "100%" }}>
                <div className="col col-12">
                  <div className="content-em-1">
                    <div>
                      <Routes>

                        {/* Home */}
                        <Route path='/' />

                         {/* menus */}
                        <Route path='/menus/' element={<MenusIndex/>}/>
                        <Route path='/menus/:category' element={<MenusIndex/>}/>
                        <Route path='/menus/:category/:name' element={<MenusView/>}/>
                        <Route path='/menus/add' element={<MenusEdit/>}/>
                        <Route path='/menus/:name' />

                        {/* tables */}
                        <Route path='/tables/' element={<TablesIndex/>}/>
                        <Route path='/tables/:name' element={<TablesView/>}/>
                        <Route path='/tables/add' element={<TablesEdit/>}/>
                        <Route path='/tables/:name' />
                        <Route path='/menu/:name' />

                        {/* customers */}
                        {/* <Route path='/customers/' element={<CustomersIndex/>}/> */}

                        {/* customers tobeSitted */}
                        <Route path='/customers/:queue/' element={<CustomersIndex/>}/>
                        <Route path='/customers/:queue/:name' element={<CustomersView/>}/>
                        {/* <Route path='/customers/tobeSitted/' /> */}
                        {/* <Route path='/customers/tobeSitted/:name' /> */}
                        {/* <Route path='/customers/tobeSitted/' /> */}

                        {/* customers Sitting */}
                        {/* <Route path='/customers/sitting/' />
                        <Route path='/customers/sitting/:GroupSeqNo' />
                        <Route path='/customers/sitting/:name' />
                        <Route path='/customers/sitting/:GroupSeqNo' /> */}

                        {/* reservation */}
                        {/* <Route path='/customers/sitting/:GroupSeqNo/reservation' />
                        <Route path='/customers/sitting/:GroupSeqNo/reservation/:name' />
                        <Route path='/customers/sitting/:GroupSeqNo/reservation/:name' />
                        <Route path='/customers/sitting/:GroupSeqNo/reservation' /> */}

                        {/* customers Awaiting Bill */}
                        {/* <Route path='/customers/awaitingBill/' /> */}
                        {/* <Route path='/customers/awaitingBill/:name' />
                        <Route path='/customers/awaitingBill/:name' /> */}

                      </Routes>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </BrowserRouter>
    )
  }
}

export default App;
